import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Home from './Home';
import Blog from './Blog';
import * as serviceWorker from './serviceWorker';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


// import {IndexRoute} from 'react-router';

import {
  Button,
  Navbar,
  Nav,
  Form,
  FormControl,
  InputGroup
} from "react-bootstrap";

import "bootstrap/dist/css/bootstrap.min.css";


ReactDOM.render(
  <Router>
      <Navbar bg="clear" variant="light" sticky="top" expand="lg">
        <Navbar.Brand className="Navbar-brand"><Link to="/home" style={{color:"black"}}>
          Scova Foundation
          </Link>
        </Navbar.Brand>
        <ButtonGroup aria-label="Basic example">
        <Link to="/book" style={{color:"black"}}>

  <Button variant="secondary">Book</Button>


          </Link>
          <Link to="/blog" style={{color:"black"}}>
          <Button variant="secondary">Blog</Button>
          </Link>
          </ButtonGroup>
        <InputGroup className="mb-3">
    <FormControl
      placeholder="Recipient's username"
      aria-label="Recipient's username"
      aria-describedby="basic-addon2"
    />
    <InputGroup.Append>
      <Button variant="outline-secondary">Button</Button>
    </InputGroup.Append>
  </InputGroup>
      </Navbar>

      {/* <IndexRoute component={Home} /> */}

      <Route exact path="/" component={Home}/>
      <Route path="/home"> {/* {"/" | "/home"}> */}
        <Home />
      </Route>
      <Route path="/book"> {/* {"/" | "/home"}> */}
        <App />
      </Route>
      <Route path="/blog">
        <Blog />
      </Route>
    </Router>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
